script: |
  super -f text -I q960.spq | sort > q960.out

inputs:
  - name: q960.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE + - col1 IN ( CAST ( + + col1 AS INTEGER ) * + CAST ( NULL AS INTEGER ), 73 / - + col1, - + col1 );
  - name: tab2

outputs:
  - name: q960.out
    data: |
      46	51	23
      64	77	40
      75	67	58
